for any students attending Tech Expo (which started like, 12 min ago?), I made this mobile-focused web app based on the publicly available information to help attendees more easily find companies that match his or her search criteria (majors, position sought)

http://nuwic.github.io/techexpo15/

disclaimer: i created this independently and it is not officially endorsed by MCD. Also, the map is completely made-up, as I requested but was unable to obtain layout information from the office.
